import React from 'react';
import '../styles/menu.css'; // Make sure to import your CSS file
import menupic from '../assets/pexels-mister-mister-3490364.jpg';

function Menu() {
  return (
    <div>
      <main>
        <div className='pic' style={{ height: '50vh' }}>
          <img src={menupic} alt='img' style={{ width: '100%', height: 'auto' }} />
        </div>
      </main>
    </div>
  );
}

export default Menu;
